import PostModal from './PostModal';
import './CreatePostHover.css';

postModalCall = () => <PostModal author="Subhro"/>;

const CreatePostHover = () => {
    return (
        <div>
            <button className="create-post-hover-button" onClick={postModalCall}>Create New Post</button>
        </div>
    )
}

export default CreatePostHover;
